import {resetDatabase} from 'meteor/xolvio:cleaner';

if (Meteor.isClient) {
    let pharmacist_id;

    describe('user management', function () {
        it('method creates a user', function () {
            beforeEach(function () {
                resetDatabase();
            });

            let pharmacist = {};

            pharmacist.emailVar = "example@example.com";

            pharmacist.inputPharmacistNameVar = "Example Name";
            pharmacist.inputPharmacyNameVar = "Example Pharmacy";
            pharmacist.inputContactNoVar = "0111234567";
            pharmacist.inputImageVar = "data:image/jpeg;base64,";

            pharmacist_id = Meteor.call('create_pharmacist', pharmacist);

        });
    });

    describe('user management', function () {
        it('method edits a user', function () {
            beforeEach(function () {
                resetDatabase();
            });

            let pharmacist = {};

            pharmacist.emailVar = "example@example.com";

            pharmacist.inputPharmacistNameVar = "Example Name2";
            pharmacist.inputPharmacyNameVar = "Example Pharmacy2";
            pharmacist.inputContactNoVar = "0111234560";
            pharmacist.inputImageVar = "data:image/jpeg;base64,";
            pharmacist.userId = pharmacist_id;

            Meteor.call('edit_pharmacist', pharmacist);

        });
    });
}